function render(template, data) {
    return JSON.parse(JSON.stringify(template, function (key, val) {
        var retval = val;
        if (typeof val === 'string' && val.match(/^{(.+)}$/)) {
            retval = data[val.replace(/[{|}]|\=(.+)}/g, '')];
            if (retval == null) {
                retval = val.replace(/((.*)\=)|}/g, '')
            }
        }
        return retval;
    }));
};

